/*
 * alive 값이 1이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 0이 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
int alive = 1;

int reader_count = 0;

pthread_mutex_t mutex;
pthread_mutex_t w_mutex;
pthread_mutex_t r_mutex;

/*
     * Reader 스레드는 같은 문자를 N번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
     * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
     * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
     * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *
reader(void *arg)
{
  int id, i;
  /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
  id = *(int *)arg;
  /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
  while (alive)
  {
    /*
       * 공정한 reader-writer 방식에서는
       * 1. 실행중인 writer가 있다면, 접근할 수 없다.
       * 2. Reader끼리는 중복하여 접근할 수 있다.
       * 3. 기다리고 있는 writer가 있다면, 더 이상 중복해서 접근할 수 없다.
       */

    /*
       * 만약 writer가 w_mutex의 lock을 기다리는 상황이라면,
       * writer가 mutex의 lock을 가지고 있으므로, 새로운 reader는 접근할 수 없다.
       */
    pthread_mutex_lock(&mutex);
    pthread_mutex_lock(&r_mutex); // 전역변수 값 변경을 위한 lock 획득

    /*
       * 첫번째 reader가 접근했을 경우, 이후에 들어오는 writer가 접근할 수 없도록
       * w_mutex에 lock을 걸게 된다.
       */
    if (reader_count == 0) {
      pthread_mutex_lock(&w_mutex);
    }
    reader_count++; /* 새로운 reader 가 추가*/

    pthread_mutex_unlock(&r_mutex);
    pthread_mutex_unlock(&mutex);

    /*
       * Critical Section 접근 시작
       */
    printf("<");
    for (i = 0; i < N; ++i)
      printf("%c", 'A' + id);
    printf(">");
    /*
       * Critical Section 접근 종료
       */

    pthread_mutex_lock(&r_mutex);

    /*
       * CS에서 모든 접근이 끝나면, reader_count값을 감소시킨다.
       * 만약 마지막 reader의 접근이 끝났다면, 기다리고 있는 writer에게 접근을 허용한다.
       */
    reader_count--;
    if (reader_count == 0) {
      pthread_mutex_unlock(&w_mutex);
    }
    pthread_mutex_unlock(&r_mutex);
  }
  pthread_exit(0);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 세 가지 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
  int id, i;
  struct timespec req, rem;

  /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     */
  id = *(int *)arg;
  /*
     * 이미지 출력을 천천히 하기 위해 한 줄 출력할 때마다 쉬는 시간을 1 나노초로 설정한다.
     */
  req.tv_sec = 0;
  req.tv_nsec = 1L;
  /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
  while (alive)
  {
    /*
       * 공정한 reader-writer 방식에서는 writer는
       * 1. 실행중인 reader가 있다면 접근할 수 없다.
       * 2. 한번에 한개의 writer만 접근할 수 있다.
       */

    /*
       * 만약 writer가 접근하지 않는다면, reader끼리만 mutex의 lock을 사용하므로
       * reader끼리 정지하지 않고 계속 실행한다.
       * 그러나 reader가 실행중인 상황에서 writer가 접근한다면, reader가 가지고있는 w_mutex의 lock때문에
       * writer가 mutex의 lock을 가진 채로 대기하게 된다. 즉, reader가 종료된 이후 writer가 실행 된다. (FIFO)
       */
    pthread_mutex_lock(&mutex);
    pthread_mutex_lock(&w_mutex);

    pthread_mutex_unlock(&mutex);

    /*
       * Critical Section 접근 시작
       */
    switch (id)
    {
    case 0:
      for (i = 0; i < L1; ++i)
      {
        printf("%s\n", t[i]);
        nanosleep(&req, &rem);
      }
      break;
    case 1:
      for (i = 0; i < L2; ++i)
      {
        printf("%s\n", d[i]);
        nanosleep(&req, &rem);
      }
      break;
    case 2:
      for (i = 0; i < L3; ++i)
      {
        printf("%s\n", e[i]);
        nanosleep(&req, &rem);
      }
      break;
    }
    /*
       * Critical Section 접근 종료
       */
      
    pthread_mutex_unlock(&w_mutex);
  }
  pthread_exit(0);
}

/*
 * 메인 함수는 RNUM 개의 reader 스레드를 생성하고, WNUM 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 자연스럽게 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
  int i;
  int rarg[RNUM], warg[WNUM];
  pthread_t rthid[RNUM];
  pthread_t wthid[WNUM];
  struct timespec req, rem;

  /*
     * mutex 설정
     */
  pthread_mutex_init(&mutex, NULL);
  pthread_mutex_init(&w_mutex, NULL);
  pthread_mutex_init(&r_mutex, NULL);

  /*
     * Create RNUM reader threads
     */
  for (i = 0; i < RNUM; ++i)
  {
    rarg[i] = i;
    if (pthread_create(rthid + i, NULL, reader, rarg + i) != 0)
    {
      fprintf(stderr, "pthread_create error\n");
      exit(-1);
    }
  }
  /* 
     * Create WNUM writer threads
     */
  for (i = 0; i < WNUM; ++i)
  {
    warg[i] = i;
    if (pthread_create(wthid + i, NULL, writer, warg + i) != 0)
    {
      fprintf(stderr, "pthread_create error\n");
      exit(-1);
    }
  }
  /* 
     * Wait for 0.2 second while the threads are working
     */
  req.tv_sec = 0;
  req.tv_nsec = 200000000L;
  nanosleep(&req, &rem);
  nanosleep(&req, &rem);
  /*
     * Now terminate all threads and leave
     */
  alive = 0;
  for (i = 0; i < RNUM; ++i)
    pthread_join(rthid[i], NULL);
  for (i = 0; i < WNUM; ++i)
    pthread_join(wthid[i], NULL);

  /*
     * mutex 사용 종료
     */
  pthread_mutex_destroy(&mutex);
  pthread_mutex_destroy(&w_mutex);
  pthread_mutex_destroy(&r_mutex);

  exit(0);
}
